import Slider from "react-slick";


class Carousel extends Component {
    constructor(props) {
        super(props);
        this.state = { 

         settings:{
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 2,
            slidesToScroll: 1
          }
        
        }
    }
    render() { 
        var settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
          };
        let cards=[];
        return ( 
        <React.Fragment>
             <Slider {...settings}>
        <div>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
        <div>
          <h3>5</h3>
        </div>
        <div>
          <h3>6</h3>
        </div>
      </Slider>
        </React.Fragment> 
        );
    }
}
 
export default Carousel;
